import React from 'react';
import { BarChart, Bar, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer } from 'recharts';

function PerformanceChart({ data }) {
    // Veriyi ReCharts için uygun formata dönüştür
    const chartData = [
        {
            name: 'Sıralı Algoritma',
            time: data.sequential.time,
            speedup: data.sequential.speedup,
            color: '#3498db' // Mavi
        },
        {
            name: 'Temel Paralel',
            time: data.parallel.time,
            speedup: data.parallel.speedup,
            color: '#e74c3c' // Kırmızı
        },
        {
            name: 'Geliştirilmiş Paralel',
            time: data.improved.time,
            speedup: data.improved.speedup,
            color: '#2ecc71' // Yeşil
        },
        {
            name: 'Block-Based',
            time: data.blocked.time,
            speedup: data.blocked.speedup,
            color: '#f1c40f' // Sarı
        }
    ];

    return (
        <div className="chart-wrapper">
            <h5 className="text-center mb-3">Çalışma Süresi Karşılaştırması</h5>
            <ResponsiveContainer width="100%" height={300}>
                <BarChart
                    data={chartData}
                    margin={{
                        top: 5,
                        right: 30,
                        left: 20,
                        bottom: 5,
                    }}
                >
                    <CartesianGrid strokeDasharray="3 3" />
                    <XAxis dataKey="name" />
                    <YAxis label={{ value: 'Çalışma Süresi (sn)', angle: -90, position: 'insideLeft' }} />
                    <Tooltip formatter={(value) => value.toFixed(6)} />
                    <Legend />
                    {chartData.map((entry, index) => (
                        <Bar key={index} dataKey="time" fill={entry.color} name={entry.name} />
                    ))}
                </BarChart>
            </ResponsiveContainer>

            <h5 className="text-center mb-3 mt-5">Hızlanma (Speedup) Karşılaştırması</h5>
            <ResponsiveContainer width="100%" height={300}>
                <BarChart
                    data={chartData}
                    margin={{
                        top: 5,
                        right: 30,
                        left: 20,
                        bottom: 5,
                    }}
                >
                    <CartesianGrid strokeDasharray="3 3" />
                    <XAxis dataKey="name" />
                    <YAxis label={{ value: 'Hızlanma (Speedup)', angle: -90, position: 'insideLeft' }} />
                    <Tooltip formatter={(value) => value.toFixed(2)} />
                    <Legend />
                    {chartData.map((entry, index) => (
                        <Bar key={index} dataKey="speedup" fill={entry.color} name={entry.name} />
                    ))}
                </BarChart>
            </ResponsiveContainer>
        </div>
    );
}

export default PerformanceChart;
